const App = () => {
 
  const [name, setname] = useState('');

  const hanchan = (e)=>{
e.target.value;
  };

  const hansub = () => {

    setname(name );
  };

  return(
    <>
    <input type="text"
    name='fname'
    value={name}
    onChange={hanchan} />

<button onClick={hansub}>
  click
</button>
    </>
  ) ;
};

export default App;
